package ra.dev.model.entity;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import javax.persistence.*;@Entity@Getter@Setter@AllArgsConstructor@NoArgsConstructor@Table(name = "Cart")public class Cart {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    @Column(name = "CartID")    private int cartID;    @ManyToOne    @JoinColumn(name = "Product")    private Product product;    @Column(name = "Quantity")    private int quantity;    @Column(name = "Discount")    private int discount;    @Column(name = "Note")    private String note;    @Column(name = "userID")    private int userID;}